/*Table structure for table `migrations` */

DROP TABLE IF EXISTS `migrations`;

CREATE TABLE `migrations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `migration` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `batch` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `migrations` */

insert  into `migrations`(`id`,`migration`,`batch`) values (1,'2014_10_12_000000_create_users_table',1),(2,'2014_10_12_100000_create_password_resets_table',1),(3,'2019_08_19_000000_create_failed_jobs_table',1),(4,'2021_07_19_000000_create_jobs_table',1);

/*Table structure for table `notification_logs` */

DROP TABLE IF EXISTS `notification_logs`;

CREATE TABLE `notification_logs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `notification_id` bigint(20) DEFAULT NULL COMMENT 'Id của thông báo chung',
  `receiver_id` bigint(20) DEFAULT NULL COMMENT 'Id của user nhận thông báo',
  `is_read` tinyint(1) DEFAULT 0 COMMENT 'Trạng thái: 0-Chưa đọc, 1-Đã đọc',
  `read_at` datetime DEFAULT NULL COMMENT 'Đọc lúc nào',
  `created_at` datetime DEFAULT NULL COMMENT 'Ngày tạo',
  `updated_at` datetime DEFAULT NULL COMMENT 'Ngày cập nhật',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `notification_logs` */

/*Table structure for table `notifications` */

DROP TABLE IF EXISTS `notifications`;

CREATE TABLE `notifications` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `scope` varchar(25) DEFAULT 'ORDER' COMMENT 'Phạm vi thông báo theo chức năng: ALL/ORDER/CUSTOMER/REPORT',
  `title` varchar(255) NOT NULL COMMENT 'Tên thông báo',
  `content` text DEFAULT NULL COMMENT 'Nội dung chi tiết',
  `receiver_id` bigint(20) DEFAULT NULL COMMENT 'Id của user nhận thông báo',
  `is_read` tinyint(1) DEFAULT 0 COMMENT 'Trạng thái: 0-Chưa đọc, 1-Đã đọc',
  `read_at` datetime DEFAULT NULL COMMENT 'Đọc lúc nào',
  `created_at` datetime DEFAULT NULL COMMENT 'Ngày tạo',
  `updated_at` datetime DEFAULT NULL COMMENT 'Ngày cập nhật',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;

